// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SupplyChainTracker {

    struct Product {
        string id;
        string name;
        string batch;
        address payable manufacturer;
        address payable currentHolder;
        uint price;
        string status;
        string ipfsHash; // hash to off-chain docs
        address[] history;
        bool sold;
    }

    mapping(string => Product) private products; // id => Product
    mapping(string => bool) private exists;

    event ProductAdded(string id, string name, address manufacturer);
    event ProductTransferred(string id, address from, address to);
    event ProductStatusUpdated(string id, string status);
    event ProductPurchased(string id, string name, uint price, address buyer);

    modifier onlyHolder(string memory _id) {
        require(products[_id].currentHolder == msg.sender, "Not product holder");
        _;
    }

    function addProduct(
        string memory _id,
        string memory _name,
        string memory _batch,
        uint _price,
        string memory _status,
        string memory _ipfsHash
    ) public {
        require(!exists[_id], "Product already exists");

        Product storage newProduct = products[_id];
        newProduct.name = _name;
        newProduct.id = _id;
        newProduct.batch = _batch;
        newProduct.price = _price;
        newProduct.manufacturer = payable(msg.sender);  // Cast msg.sender to address payable
        newProduct.currentHolder = payable(msg.sender);  // Cast msg.sender to address payable
        newProduct.status = _status;
        newProduct.ipfsHash = _ipfsHash;
        newProduct.sold = false;
        newProduct.history.push(msg.sender);

        exists[_id] = true;

        emit ProductAdded(_id, _name, msg.sender);
    }

    function purchaseProduct(string memory _id) public payable {
        require(exists[_id], "Product does not exist");

        Product storage p = products[_id];
        require(!p.sold, "Product already sold");
        require(msg.sender != p.currentHolder, "Cannot buy your own product");
        require(msg.value >= p.price, "Insufficient Ether sent");

        address payable seller = p.currentHolder;

        // Transfer ownership
        p.currentHolder = payable(msg.sender);  // Cast msg.sender to address payable
        p.sold = true;
        p.history.push(msg.sender);

        // Transfer Ether to seller
        seller.transfer(msg.value);

        emit ProductPurchased(_id, p.name, p.price, msg.sender);
        emit ProductTransferred(_id, seller, msg.sender);
    }

    function transferProduct(string memory _id, address _to)
        public
        onlyHolder(_id)
    {
        products[_id].currentHolder = payable(_to);  // Cast _to to address payable
        products[_id].history.push(_to);

        emit ProductTransferred(_id, msg.sender, _to);
    }

    function updateStatus(string memory _id, string memory _status)
        public
        onlyHolder(_id)
    {
        products[_id].status = _status;
        emit ProductStatusUpdated(_id, _status);
    }

    function getProduct(string memory _id)
        public
        view
        returns (
            string memory name,
            string memory batch,
            address manufacturer,
            address holder,
            uint price,
            string memory status,
            string memory ipfsHash,
            address[] memory history,
            bool sold
        )
    {
        require(exists[_id], "Product does not exist");
        Product storage p = products[_id];
        return (
            p.name,
            p.batch,
            p.manufacturer,
            p.currentHolder,
            p.price,
            p.status,
            p.ipfsHash,
            p.history,
            p.sold
        );
    }
}
